INSERT INTO `adminnotification_inbox` VALUES (1,4,'2022-01-04 17:00:38','Disable Notice','To improve performance, collecting statistics for the Magento Report module is disabled by default. \nYou can enable it in System Config.','',0,1),(2,2,'2022-02-17 16:50:11','Security update available for Adobe Commerce | APSB22-12','Adobe has released security updates for Adobe Commerce and Magento Open Source. These updates resolve vulnerabilities rated critical. Full details included in security bulletin.','https://helpx.adobe.com/security/products/magento/apsb22-12.html',0,1),(3,2,'2022-03-01 23:30:48','Adobe Commerce 2.4.4 Pre-Release Coming March 29, GA on April 12 ','To help ensure this release delivers the highest standards of security and quality, the pre-release period for Adobe Commerce 2.4.4 is now planned to begin on March 29, two weeks prior to the general availability date of April 12. For more information, visit our DevBlog.','https://community.magento.com/t5/Magento-DevBlog/Adobe-Commerce-2-4-4-Now-Coming-April-12/ba-p/492935',0,1),(4,1,'2020-04-28 18:28:20','Magento Commerce 2.3.5-p1 delivers important security updates and features to help you save time and maximize resources ','The latest releases of Magento Commerce – 2.3.5-p1 and 2.3.4-p2 – are now generally available. The latest release of Magento Commerce includes important security enhancements along with new functionality and platform quality improvements. With these important updates we strongly recommend that you upgrade to ensure your sites maintain the highest level of security. You can review the release notes for more information about all of the enhancements. Learn how this release can help you save time and maximize resources at Magento.com/blog ','https://devdocs.magento.com/guides/v2.3/release-notes/bk-release-notes.html',0,0),(5,4,'2020-06-16 19:18:26','Your input requested: Shipping &amp; Fulfillment','We would like to get your feedback on how you think about and manage your shipping &amp; fulfillment so we can build great features for you! http://selfserve.decipherinc.com/survey/selfserve/9d5/200603 ','http://selfserve.decipherinc.com/survey/selfserve/9d5/200603',0,0),(6,4,'2020-07-28 16:11:04','Tell us about your experience with Magento','We want to hear from you! Please take a short survey about your experience using Magento Admin. Your feedback will help us improve our products and develop new features.  http://selfserve.decipherinc.com/survey/selfserve/9d5/200508?list=1','http://selfserve.decipherinc.com/survey/selfserve/9d5/200508?list=1',0,0),(7,4,'2020-07-28 16:13:36','Aggregated log data availability of Magento Commerce on New Relic platform.','We are proud to announce the availability of aggregated log data of Magento Commerce PRO on cloud. In partnership with New Relic, Magento Commerce on cloud now offers a fast, scalable log management platform that supports connections across cloud infrastructure to collect telemetry data from various services and applications.  ','https://devdocs.magento.com/cloud/project/log-locations.html',0,0),(8,1,'2020-07-28 16:16:22','Magento Commerce 2.4 delivers important security updates and features to accelerate your business in the changing commerce landscape – 7/28/2020','The latest releases of Magento Commerce – 2.4 and 2.3.5-p2 – are now available. The latest release of Magento Commerce includes important security enhancements along with new functionality and platform quality improvements. With these important updates we strongly recommend that you upgrade to ensure your sites maintain the highest level of security. You can review the release notes for more information about all of the enhancements. Learn how this release can help you adapt to the changing commerce landscape at Magento.com/blog','https://devdocs.magento.com/guides/v2.4/release-notes/bk-release-notes.html',0,0),(9,4,'2020-08-24 17:18:22','We would love your input on Magento Payments.','We value the perspective of our users and we would appreciate if you took this short survey on Magento Payments. Your response will influence the design of the next generation Magento Payments solution. https://bit.ly/2CXZro2','https://bit.ly/2CXZro2',0,0),(10,4,'2020-09-14 13:32:28','Get real-time insights into the security status of the store​ with Enhanced Security Scan Tool.','The Enhanced Magento Security Scan Tool provides our on-prem and cloud merchants with real-time insights into the security status of their store by proactively notifying them if their store is vulnerable. ','https://account.magento.com/scanner ',0,0),(11,1,'2020-09-14 13:35:12','Site Wide Analysis Tool for end-to-end site analysis and offering a holistic view of the health of the site ','The Site-Wide Analysis tool runs a series of checks against your Magento Commerce stores (Cloud only) to identify performance, stability, and configuration issues. A report will be generated describing issue, identify the root cause, and Adobe’s recommendations to resolve it. ','https://magento.com/blog/magento-news/Magento-Security-Scan-Tool-Enhancements',0,0),(12,4,'2020-09-14 13:36:35','Now Available: Magento Quality Patch (MQP) tool to identify and resolve issues more quickly','The introduction of the MQP tool provides a way for you to know which quality patches are available for you installed version and apply or revert them giving you self-service access to resolve issues more quickly.','https://support.magento.com/hc/en-us/articles/360047139492-Magento-Quality-Patches-released-a-new-tool-to-self-serve-quality-patches',0,0),(13,4,'2020-09-14 13:39:21','Split DB performance solution survey','Please take our 1 question survey about our Split DB performance solution.','https://bit.ly/331tUdZ',0,0),(14,4,'2020-10-09 02:23:13','[Commerce Webinar] Is Your Website Ready for the 2020 Holiday Season?','Your site speed can make or break your conversion rate this holiday season and beyond. Join us on October 15th for a fireside chat &quot;Is Your Website Ready for the 2020 Holiday Season?&quot; to learn what Commerce features you must have, and how to scale your webstore to maximize conversion rates. If you can&#039;t make the live webinar, be sure to register anyway and we&#039;ll send you the recording and slides afterward. Register Now: https://bit.ly/36NwqHV','https://bit.ly/36NwqHV',0,0),(15,4,'2020-11-02 15:46:48','You&#039;re Invited! Magento&#039;s customer-exclusive Commerce Quarterly webinar is Thursday, November 5th','Register today for the next Commerce Quarterly on November 5th for a customer-exclusive session. Adobe Commerce executives will share the 2021 Magento product roadmap to help your business adapt to changes in eCommerce and set your business up for success in the new year. We’ll also provide a live demonstration of new functionality available in Magento 2.4.1.. Register at https://bit.ly/Magento2021Roadmap','http://bit.ly/Magento2021Roadmap',0,0),(16,4,'2020-11-04 14:28:35','Please help prioritize our roadmap - SHORT survey','We are looking to better understand how we can help you manage all of your digital ecommerce from one place. Please help us prioritize our roadmap! Very short survey is here! http://selfserve.decipherinc.com/survey/selfserve/9d5/201000','http://selfserve.decipherinc.com/survey/selfserve/9d5/201000',0,0),(17,4,'2021-05-11 20:44:02','Adobe Commerce 2.4.2-p1 and 2.3.7 deliver important security updates','The latest releases of Adobe Commerce – 2.3.7 and 2.4.2-p1 – are now generally available. The latest release of Adobe Commerce includes important security updates. With these important updates we strongly recommend that you upgrade to ensure your sites maintain the highest level of security. You can review the release notes for more information about all of the updates. Learn how this release can help you save time and maximize resources at Magento.com/blog.','https://devdocs.magento.com/guides/v2.3/release-notes/bk-release-notes.html ',0,0),(18,4,'2021-06-10 18:29:25','Magento 2.3 reaches end of support on April 28, 2022','Support for Magento 2.3 will end on April 28, 2022. We recommend all sites still running on Magento Commerce 2.3 migrate as soon as possible to version 2.4.x. Your Adobe Customer Success Manager is available to provide guidance and resources in planning your upgrade. ','https://devdocs.magento.com/release/lifecycle-policy.html',0,0),(19,4,'2021-06-22 21:14:38','Live Search from Adobe Commerce - learn more','Introducing Live Search, available exclusively for Adobe Commerce customers - and it is FREE! Get the extension in the Marketplace today!','https://magento.com/blog/magento-news/introducing-live-search-adobe-commerce',0,0),(20,4,'2021-08-10 17:52:26','Adobe Commerce 2.4.3 available today!','Adobe Commerce 2.4.3, along with security-only patches 2.4.2-p1 and 2.3.7-p2, is now generally available. Adobe Commerce 2.4.3 includes 33 security and 370+ quality improvements, along with performance and scale enhancements. With these important updates, we strongly recommend that you upgrade to maintain the highest level of security for your sites. Learn how this release can help you save time and maximize resources in our release blog. ','http://magento.com/blog/magento-news/get-ready-your-peak-season-adobe-commerce-243',0,0),(21,4,'2021-10-01 14:43:54','New, Simplified Upgrade Process and Lifecycle Policy Helps Reduce Your TCO ','Adobe Commerce developed a new release strategy and updated its lifecycle policy in effort to help Merchants lower their total cost of ownership and accelerate their time to innovation. Learn more about how upgrades are now more predictable and easier to implement in our blog.','https://magento.com/blog/accelerating-innovation-through-simplified-release-strategy ',0,0),(22,4,'2021-10-11 16:40:44','Peak Season Updates for Adobe Commerce Customers','Many merchants are heading towards the busiest time of year, and our three-part series on preparing for peak season is now available via the URL posted with this message. The articles include recommendations regarding site infrastructure, customer experience and front-end design, among many other topics. Additionally, if your site is hosted on our cloud infrastructure and you’ve realized that your site needs upsizing for improved performance, please follow the steps outlined in the first blog post.   ','https://magento.com/blog/best-practices/five-ps-peak-season-performance-guide-preparing-your-infrastructure-high  ',0,0),(23,4,'2021-10-22 19:07:39','Magento Technology Stack Evaluation Survey','Please take a few minutes to fill out this survey https://forms.office.com/r/DLN8K3h2h0. We appreciate your effort to support the future of Adobe Commerce!','https://forms.office.com/r/DLN8K3h2h0',0,0),(24,2,'2022-04-12 16:52:12','Adobe Commerce 2.4.4 Available Now!','Adobe Commerce 2.4.4 enables customers to future-proof and accelerate the growth of their digital commerce businesses. This release is our fastest and most scalable version ever, with increased GraphQL API coverage for B2B and Admin features, as well as new capabilities in PWA Studio 12.3. We’ve also expanded Site-Wide Analysis Tool to Adobe Commerce customers hosted on-premise, providing merchants with real-time monitoring, reporting, insights, and recommendations. Learn how this release can help you save time and maximize resources in our release blog. ','https://business.adobe.com/blog/perspectives/future-proof-your-business-with-adobe-commerce-2-4-4',1,0),(25,4,'2022-05-24 15:07:14','Prepared to upgrade to Adobe Commerce 2.4.4?','With 2.3 end of support (EOS) in September and 2.4.0-2.4.3 EOS in November, it is critical to have an upgrade plan in place to make sure your site stays secure, performant and PCI-Compliant. Learn more about how Adobe Commerce 2.4.4 will future-proof your business.','https://business.adobe.com/blog/perspectives/future-proof-your-business-with-adobe-commerce-2-4-4',1,0),(26,4,'2022-07-26 16:19:00','Expanded video library on the Adobe Commerce Experience League','Check out our expanded video library on the Adobe Commerce Experience League that now has a set of 35 short demo videos of our core Adobe Commerce capabilities and support tools.','https://experienceleague.adobe.com/docs/commerce-learn/tutorials/overview.html?lang=en',0,0);
